import React, { useState } from 'react';
import axios from 'axios';

const ParkingSpaces = () => {
  const [villaName, setVillaName] = useState('');
  const [address, setAddress] = useState('');
  const [spaces, setSpaces] = useState([]);
  const [villaId, setVillaId] = useState('');

  const handleSave = async () => {
    try {
      const response = await axios.post('http://localhost:3001/api/villa/save', { villaName, address, spaces, villaId }, { withCredentials: true });
      console.log('Villa saved:', response.data);
    } catch (error) {
      console.error('Error saving villa:', error);
      alert('빌라 저장 중 오류가 발생했습니다.');
    }
  };

  return (
    <div>
      <h2>빌라 만들기</h2>
      <div>
        <label>빌라 이름</label>
        <input type="text" value={villaName} onChange={(e) => setVillaName(e.target.value)} />
      </div>
      <div>
        <label>주소</label>
        <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} />
      </div>
      <div>
        <label>주차 공간</label>
        <textarea value={spaces} onChange={(e) => setSpaces(e.target.value.split(','))} />
      </div>
      <div>
        <label>빌라 ID</label>
        <input type="text" value={villaId} onChange={(e) => setVillaId(e.target.value)} />
      </div>
      <button onClick={handleSave}>저장</button>
    </div>
  );
};

export default ParkingSpaces;
